# @brief Transforms raw image data to painter image
# @param[in] raw grayscale data array
# @param[in] image width
# @param[in] image height
def raw_to_prim(image, width, height):
 
    output = blank_bb

    for i in range(height):  
        # Init row painter to first pixel of each row
        row = black_bb if image[width * i] == 0 else blank_bb  

        # Stack subsequent row pixels depending on pixel brightness
        for j in range(1, width):
            pixel = black_bb if image[width * i + j] == 0 else blank_bb
            row = stack_frac(1 / (j + 1), pixel, row)

        # Rotate row & stack onto output image
        output = stack_frac((i + 1) / (i + 2), output, quarter_turn_right(row)) 

    return output

show(raw_to_prim(image, 400, 310))





